    }

    toggleSwitch = () => {  
        this.setState({
        isSwitchOn: !this.state.isSwitchOn,
    });


};


    render() {

        return(
        <div>
        <Title switchOn={this.state.isSwitchOn} />
        <Button toggleSwitch={this.toggleSwitch} />
        </div>
        ) 
    }
}

export default Parent;
